import Layout from "./layout";

function Navbar() {
  return (
    <Layout>
<nav class="navbar">
      <div class="container">
        <a href="#">Hulk</a>
        
        <a href="#" class="logo is-active">Mavel</a>
        <a href="#">Venom</a>
      </div>

      <style jsx>
        {`
        .navbar{
          background-color:black;
          height:50px
        }`}
      </style>
    </nav>
    </Layout>
    
  )
}
export default Navbar;
